import React from 'react';

function ImagePopup(props) {
    const { card, onClose } = props;

    return (
        <>

    <div className={`"popup" ${card.name && 'popup_opened'}`} onClick={onClose} id="imagePlacePopup" tabIndex="-1">
        <div className="popup__container popup__container_type_preview">
            <img className="popup__image"
                src={card.link} alt={card.name} />
            <button type="button" className="button popup__close-button"></button>
            <h2 className="popup__header popup__header_type_preview">{card.name}</h2>
        </div>
    </div>

</>
        )
}

export default ImagePopup
